import React from 'react'

class Logout extends React.Component {

  logout = (e) => {
    e.preventDefault();
    localStorage.setItem('token', '');
    this.props.history.push('/')

  }

  render() {
    return (
      <button onCLick={this.logout}>Log out</button>
    )
  }

}

export default Logout
